#include <string>
#include <vector>
#include <algorithm>
#include <math.h>
#include <iostream>
#include <iomanip>
 
using namespace std;
 
class SMBus {
  public:
  int transmitTime(vector <string> messages, vector <int> times) {
    vector<bool> trans;
    vector<bool> done;
    vector<int> pos;
    bool alldone = false;
    for(int i=0;i<messages.size();i++) {
      trans.push_back(true);
      done.push_back(false);
      pos.push_back(0);
    }
    
    int time=0;
    while(!alldone) {
      int low = 9;
      int bigtime = 0;
      // gets low and find slow time
      for(int i=0;i<messages.size();i++) {
        if(trans[i] && !done[i]) {
          if(messages[i][pos[i]]-'0' < low) {
            low = messages[i][pos[i]]-'0';
          }
          if(times[i] > bigtime) {
            bigtime = times[i];
          }
        }
      }
      // stops those that arent low
      for(int i=0;i<messages.size();i++) {
        if(trans[i] && !done[i]) {
          if(messages[i][pos[i]]-'0' > low) {
            pos[i] = 0;
            trans[i]= false;
          }
        }
      }
      time += bigtime;
      
      // go forward start over if one finishes
      bool change = false;
      for(int i=0;i<messages.size() && !change;i++) {
        if(trans[i] && !done[i]) {
          pos[i]++;
          if(pos[i] >= messages[i].length()) {
            done[i] = true;
            change = true;
            for(int j=0;j<messages.size();j++) {
              pos[j] = 0;
              trans[j] = true;
            }
          }
        }
      }
      alldone = true;
      for(int i=0;i<messages.size();i++) {
        if(!done[i]) alldone = false;
      }
    }
    return time;
      
  }
};
 
